def candy(ratings):
    n = len(ratings)
    candies = [1]*n

    for i in range(1, n):
        if ratings[i] > ratings[i-1]:
            candies[i] = candies[i-1] + 1

    for i in range(n-2, -1, -1):
        if ratings[i] > ratings[i+1]:
            candies[i] = max(candies[i], candies[i+1] + 1)

    return sum(candies)

def convertToBase7(num):
    if num == 0:
        return "0"

    result = ""
    is_negative = num < 0
    num = abs(num)

    while num > 0:
        result = str(num % 7) + result
        num //= 7

    return "-" + result if is_negative else result

