def findMinStep(board, hand):
    def dfs(board, hand):
        if not board:
            return 0
        if not hand:
            return -1
        res = float('inf')
        i, j = 0, 0
        while i < len(board):
            while j < len(board) and board[j] == board[i]:
                j += 1
            need = max(0, 3 - (j - i))
            if hand[board[i]] >= need:
                next_board = update(board[:i] + board[j:], need)
                next_hand = hand
                next_hand[board[i]] -= need
                next_res = dfs(next_board, next_hand)
                if next_res != -1:
                    res = min(res, need + next_res)
            i = j
        return res if res != float('inf') else -1

    def update(board, need):
        i, j = 0, 0
        while j < len(board):
            while j < len(board) and board[j] == board[i]:
                j += 1
            if j - i >= 3:
                return update(board[:i] + board[j:], need)
            i = j
        return board

    board_dict = {}
    for ball in board:
        if ball in board_dict:
            board_dict[ball] += 1
        else:
            board_dict[ball] = 1

    hand_dict = {}
    for ball in hand:
        if ball in hand_dict:
            hand_dict[ball] += 1
        else:
            hand_dict[ball] = 1

    res = dfs(board, hand_dict)
    return res if res != float('inf') else -1

def updateMatrix(mat):
    rows, cols = len(mat), len(mat[0])
    queue = []
    for i in range(rows):
        for j in range(cols):
            if mat[i][j] == 0:
                queue.append((i, j))
            else:
                mat[i][j] = float('inf')

    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    while queue:
        curr_i, curr_j = queue.pop(0)
        for d in directions:
            new_i, new_j = curr_i + d[0], curr_j + d[1]
            if 0 <= new_i < rows and 0 <= new_j < cols and mat[new_i][new_j] > mat[curr_i][curr_j] + 1:
                mat[new_i][new_j] = mat[curr_i][curr_j] + 1
                queue.append((new_i, new_j))

    return mat

