def numBusesToDestination(routes, source, target):
    if source == target:
        return 0

    stop_to_routes = defaultdict(set)
    for i, stops in enumerate(routes):
        for stop in stops:
            stop_to_routes[stop].add(i)

    buses = deque()
    buses.extend(stop_to_routes[source])
    visited = set(stop_to_routes[source])
    cnt = 1

    while buses:
        for _ in range(len(buses)):
            bus = buses.popleft()
            for stop in routes[bus]:
                if stop == target:
                    return cnt
                for next_bus in stop_to_routes[stop]:
                    if next_bus not in visited:
                        visited.add(next_bus)
                        buses.append(next_bus)
        cnt += 1

    return -1

def floodFill(image, sr, sc, newColor):
    if image[sr][sc] == newColor:
        return image

    def dfs(image, i, j, color, newColor):
        if i < 0 or i >= len(image) or j < 0 or j >= len(image[0]) or image[i][j] != color:
            return
        image[i][j] = newColor
        dfs(image, i+1, j, color, newColor)
        dfs(image, i-1, j, color, newColor)
        dfs(image, i, j+1, color, newColor)
        dfs(image, i, j-1, color, newColor)

    dfs(image, sr, sc, image[sr][sc], newColor)
    return image

