def deserialize(s):
    stack = []
    num = ''

    for char in s:
        if char == '[':
            stack.append(NestedInteger())
        elif char == ']':
            if num:
                stack[-1].value.append(NestedInteger(int(num)))
                num = ''
            top = stack.pop()
            if stack:
                stack[-1].value.append(top)
            else:
                return top
        elif char == ',':
            if num:
                stack[-1].value.append(NestedInteger(int(num)))
                num = ''
        else:
            num += char

    if num:
        return NestedInteger(int(num))
    return None

