def is_subset(a, b):
    dict_a = {}
    dict_b = {}

    for char in a:
        dict_a[char] = dict_a.get(char, 0) + 1

    for char in b:
        dict_b[char] = dict_b.get(char, 0) + 1

    for char in dict_b:
        if char not in dict_a or dict_b[char] > dict_a[char]:
            return False

    return True

def universal_strings(words1, words2):
    universal = []

    for a in words1:
        is_universal = True
        for b in words2:
            if not is_subset(a, b):
                is_universal = False
                break
        if is_universal:
            universal.append(a)

    return universal

