    memo = {}

    def dp(l, r, k):
        if l > r:
            return 0
        if (l, r, k) in memo:
            return memo[(l, r, k)]

        while r > l and boxes[r] == boxes[r-1]:
            r -= 1
            k += 1

        result = dp(l, r-1, 0) + (k+1) * (k+1)

        for i in range(l, r):
