def catMouseGame(graph):
    n = len(graph)
    DRAW, MOUSE, CAT = 0, 1, 2
    color = [[[0] * 3 for _ in range(n)] for _ in range(n)]

    for i in range(1, n):
        for j in range(1, n):
            color[0][i][j] = 1

    q = deque()
    for i in range(1, n):
        for t in range(1, 3):
            color[i][i][t] = 2
            q.append((i, i, t))

    while q:
        x, y, t = q.popleft()
        for prevX, prevY, prevT in getPrev(x, y, t, graph):
            if color[prevX][prevY][prevT] == DRAW:
                if prevT == color[x][y][t]:
                    color[prevX][prevY][prevT] = t
                    q.append((prevX, prevY, prevT))
                else:
                    color[prevX][prevY][prevT] = color[x][y][t]
                    q.appendleft((prevX, prevY, prevT))

    return color[1][2][1]

def getPrev(x, y, t, graph):
    if t == 2:
        for prevX in graph[x]:
            yield prevX, y, 1
    else:
        for prevY in graph[y]:
            if prevY != 0:
                yield x, prevY, 2
    return

