def stone_game(stones):
    n = len(stones)
    dp = [[0] * n for _ in range(n)]

    for i in range(n):
        dp[i][i] = stones[i]

    for length in range(2, n + 1):
        for i in range(n - length + 1):
            j = i + length - 1
            dp[i][j] = max(stones[i] - dp[i+1][j], stones[j] - dp[i][j-1])

    return dp[0][n-1]

