def findLadders(beginWord, endWord, wordList):
    wordList = set(wordList)
    if endWord not in wordList:
        return []

    layer = {}
    layer[beginWord] = [[beginWord]]

    while layer:
        new_layer = defaultdict(list)
        for word in layer:
            if word == endWord:
                return layer[word]
            for i in range(len(word)):
                for c in 'abcdefghijklmnopqrstuvwxyz':
                    new_word = word[:i] + c + word[i + 1:]
                    if new_word in wordList:
                        new_layer[new_word] += [j + [new_word] for j in layer[word]]

        wordList -= set(new_layer.keys())
        layer = new_layer

    return []

def numDecodings(s):
    MOD = 10**9 + 7
    dp = [1, 9 if s[0] == '*' else 1]

    for i in range(1, len(s)):
        if s[i] == '*':
            ways = 9 * dp[i]
            if s[i-1] == '1':
                ways = (ways + 9 * dp[i-1]) % MOD
            elif s[i-1] == '2':
                ways = (ways + 6 * dp[i-1]) % MOD
            elif s[i-1] == '*':
                ways = (ways + 15 * dp[i-1]) % MOD
        else:
            ways = dp[i] if s[i] != '0' else 0
            if s[i-1] == '1' or (s[i-1] == '2' and s[i] <= '6'):
                ways = (ways + dp[i-1]) % MOD
            elif s[i-1] == '*':
                ways = (ways + (2 if s[i] <= '6' else 1) * dp[i-1]) % MOD

        dp.append(ways)

    return dp[-1]

