def slidingPuzzle(board):
    target = [[1,2,3],[4,5,0]]
    moves = 0
    queue = [(board, 0)]
    visited = set()

    while queue:
        current, moves = queue.pop(0)
        if current == target:
            return moves
        visited.add(tuple(map(tuple, current)))
        zero_row, zero_col = next((i, j) for i, row in enumerate(current) for j, val in enumerate(row) if val == 0)
        for dr, dc in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            new_row, new_col = zero_row + dr, zero_col + dc
            if 0 <= new_row < 2 and 0 <= new_col < 3:
                new_board = [list(row) for row in current]
                new_board[zero_row][zero_col], new_board[new_row][new_col] = new_board[new_row][new_col], new_board[zero_row][zero_col]
                if tuple(map(tuple, new_board)) not in visited:
                    queue.append((new_board, moves + 1))
                    visited.add(tuple(map(tuple, new_board)))

    return -1

