def findWords(board, words):
    def backtrack(i, j, word, seen):
        if i < 0 or i >= len(board) or j < 0 or j >= len(board[0]) or board[i][j] == '#' or board[i][j] not in word:
            return

        seen.add((i, j))
        word += board[i][j]

        if word in words:
            result.add(word)

        backtrack(i+1, j, word, seen.copy())
        backtrack(i-1, j, word, seen.copy())
        backtrack(i, j+1, word, seen.copy())
        backtrack(i, j-1, word, seen.copy())

        seen.remove((i, j))

    result = set()

    for i in range(len(board)):
        for j in range(len(board[0])):
            backtrack(i, j, '', set())

    return list(result)

