def outerTrees(trees):
    def orientation(p, q, r):
        return (q[1] - p[1]) * (r[0] - q[0]) - (q[0] - p[0]) * (r[1] - q[1)

    def build_convex_hull(points):
        points.sort()
        hull = []

        for p in points:
            while len(hull) >= 2 and orientation(hull[-2], hull[-1], p) > 0:
                hull.pop()
            hull.append(p)

        for p in reversed(points[:-1]):
            while len(hull) >= 2 and orientation(hull[-2], hull[-1], p) > 0:
                hull.pop()
            hull.append(p)

        return hull

    trees.sort()
    upper = build_convex_hull(trees)
    lower = build_convex_hull(trees[::-1])

    return list(set(upper + lower))

