def countOfAtoms(formula):
    stack = []
    i = 0
    while i < len(formula):
        if formula[i] == '(':
            stack.append('(')
            i += 1
        elif formula[i] == ')':
            i += 1
            j = i
            while j < len(formula) and formula[j].isdigit():
                j += 1
            count = int(formula[i:j]) if i < j else 1
            i = j
            top = stack.pop()
            while top != '(':
                for atom, cnt in top.items():
                    stack[-1][atom] = stack[-1].get(atom, 0) + cnt * count
                top = stack.pop()
        else:
            j = i + 1
            while j < len(formula) and formula[j].islower():
                j += 1
            atom = formula[i:j]
            i = j
            while j < len(formula) and formula[j].isdigit():
                j += 1
            count = int(formula[i:j]) if i < j else 1
            i = j
            stack[-1][atom] = stack[-1].get(atom, 0) + count
    ans = ''
    for atom, cnt in sorted(stack[0].items()):
        ans += atom + str(cnt) if cnt > 1 else atom
    return ans

