def minFlips(grid):
    n = len(grid)
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    def dfs(x, y):
        if x < 0 or x >= n or y < 0 or y >= n or grid[x][y] != 1:
            return
        grid[x][y] = 2
        for dx, dy in directions:
            dfs(x + dx, y + dy)

    def bfs(x, y):
        queue = [(x, y, 0)]
        visited = set()
        while queue:
            i, j, dist = queue.pop(0)
            if grid[i][j] == 1:
                return dist - 1
            for dx, dy in directions:
                ni, nj = i + dx, j + dy
                if 0 <= ni < n and 0 <= nj < n and (ni, nj) not in visited:
                    visited.add((ni, nj))
                    queue.append((ni, nj, dist + 1))

    for i in range(n):
        for j in range(n):
            if grid[i][j] == 1:
                dfs(i, j)
                break

    min_flips = float('inf')
    for i in range(n):
        for j in range(n):
            if grid[i][j] == 0:
                min_flips = min(min_flips, bfs(i, j))

    return min_flips

