def dfs(graph, nums, node, parent, ancestors):
    closest_ancestor = -1
    for ancestor in ancestors:
        if gcd(nums[node], nums[ancestor]) == 1:
            closest_ancestor = ancestor
            break
    for neighbor in graph[node]:
        if neighbor != parent:
            closest_ancestor = max(closest_ancestor, dfs(graph, nums, neighbor, node, ancestors + [node]))
