def kSimilarity(s1, s2):
    def neighbors(s):
        for i in range(len(s)):
            if s[i] != s2[i]:
                break
        for j in range(i + 1, len(s)):
            if s[j] == s2[i]:
                yield s[:i] + s[j] + s[i + 1:j] + s[i] + s[j + 1:]

    queue = deque([(s1, 0)])
    visited = set([s1])

    while queue:
        s, k = queue.popleft()

