        return [0, len(arr) - 1]

    target_ones = total_ones // 3
    start, mid, end = -1, -1, -1
    count_ones = 0

    for i in range(len(arr)):
        if arr[i] == 1:
            count_ones += 1
            if count_ones == 1:
                start = i
            elif count_ones == target_ones + 1:
                mid = i
            elif count_ones == 2 * target_ones + 1:
                end = i
                break

    while end < len(arr) and arr[start] == arr[mid] == arr[end]:
