    min_y = min(rectangles, key=lambda x: x[1])[1]
    max_x = max(rectangles, key=lambda x: x[2])[2]
    max_y = max(rectangles, key=lambda x: x[3])[3]

    total_area = (max_x - min_x) * (max_y - min_y)
    actual_area = sum((x2 - x1) * (y2 - y1) for x1, y1, x2, y2 in rectangles)

    if actual_area != total_area:
        return False

    corners = {(x, y) for x in (min_x, max_x) for y in (min_y, max_y)}
    corners_count = collections.Counter((x, y) for x, y, _, _ in rectangles)

    for corner, count in corners_count.items():
        if count % 2 == 1 and corner not in corners:
            return False

    return True

