def nthMagicalNumber(n, a, b):
    def gcd(x, y):
        while y:
            x, y = y, x % y
        return x

    def lcm(x, y):
        return x * y // gcd(x, y)

    MOD = 10**9 + 7
    LCM = lcm(a, b)

    low = 0
    high = min(a, b) * n

    while low < high:
        mid = (low + high) // 2
        count = mid // a + mid // b - mid // LCM

        if count < n:
            low = mid + 1
        else:
            high = mid

    return low % MOD

