def braceExpansion(expression):
    stack = []
    stack.append(set())

    for char in expression:
        if char == '{':
            stack.append(set())
        elif char == '}':
            sub = stack.pop()
            prev = stack.pop()
            stack[-1] = stack[-1].union({p + s for p in prev for s in sub})
        elif char == ',':
            continue
        else:
            stack[-1].add(char)

    return sorted(list(stack.pop()))

