def parse(expr):
    if '+' in expr:
        terms = expr.split('+')
    else:
        terms = expr.split('-')
        terms = [terms[0]] + ['-' + term for term in terms[1:]]

    x = 0
    c = 0
    for term in terms:
        if 'x' in term:
            if term == 'x':
                x += 1
            elif term == '-x':
                x -= 1
            else:
                x += int(term[:-1])
        else:
            c += int(term)

    return x, c

