def findRightInterval(intervals):
    intervals_dict = {interval[0]: index for index, interval in enumerate(intervals)}
    sorted_intervals = sorted(intervals, key=lambda x: x[0])
    result = []

    for interval in intervals:
        target = interval[1]
        left, right = 0, len(intervals) - 1
        while left <= right:
            mid = (left + right) // 2
            if sorted_intervals[mid][0] == target:
                result.append(intervals_dict[sorted_intervals[mid][0]])
                break
            elif sorted_intervals[mid][0] < target:
                left = mid + 1
            else:
                right = mid - 1
        else:
            result.append(intervals_dict.get(sorted_intervals[left][0], -1))

    return result

