class Solution:
    def construct(self, grid):
        n = len(grid)
        if n == 1:
            return Node(grid[0][0] == 1, True, None, None, None, None)

        is_leaf = True
        val = grid[0][0]
        for i in range(n):
            for j in range(n):
                if grid[i][j] != val:
                    is_leaf = False
                    break
            if not is_leaf:
                break

        if is_leaf:
            return Node(val == 1, True, None, None, None, None)

        new_n = n // 2
        return Node('*',
                    False,
                    self.construct([row[:new_n] for row in grid[:new_n]]),
                    self.construct([row[new_n:] for row in grid[:new_n]]),
                    self.construct([row[:new_n] for row in grid[new_n:]]),
                    self.construct([row[new_n:] for row in grid[new_n:]]))

