from collections import defaultdict

def countGoodPaths(n, vals, edges):
    graph = defaultdict(list)
    for a, b in edges:
        graph[a].append(b)
        graph[b].append(a)

    def dfs(node, parent, max_val):
        if vals[node] != max_val:
            return 0
        count = 1
        for neighbor in graph[node]:
            if neighbor != parent:
                count += dfs(neighbor, node, max(max_val, vals[neighbor]))
        return count

    ans = 0
    for i in range(n):
        ans += dfs(i, -1, vals[i])

    return ans

