def min_len_after_deletion(s, k):
    def encode(s):
        encoded = []
        count = 1
        for i in range(1, len(s)):
            if s[i] == s[i - 1]:
                count += 1
            else:
                encoded.append((s[i - 1], count))
                count = 1
        encoded.append((s[-1], count))
        return encoded

    def decode(encoded):
        decoded = ''
        for char, count in encoded:
            decoded += char + str(count)
        return decoded

    def delete_char(encoded, k):
        i = 0
        while i < len(encoded) - 1 and k > 0:
            if encoded[i][1] <= k:
                k -= encoded[i][1]
                encoded.pop(i)
            else:
                encoded[i] = (encoded[i][0], encoded[i][1] - k)
                k = 0
            i += 1
        return encoded

    encoded = encode(s)
    encoded = delete_char(encoded, k)
    return len(decode(encoded))

