def evaluate(expression):
    def helper(scope, exp):
        if exp[0] == '-':
            return int(exp)
        if exp.isdigit() or exp[0] == '-':
            return int(exp)
        if exp in scope:
            return scope[exp]
        if exp[0] == '(':
            exp = exp[1:-1]
            tokens = exp.split()
            if tokens[0] == 'add':
                return helper(scope, tokens[1]) + helper(scope, tokens[2])
            if tokens[0] == 'mult':
                return helper(scope, tokens[1]) * helper(scope, tokens[2])
            if tokens[0] == 'let':
                new_scope = scope.copy()
                i = 1
                while i < len(tokens) - 1:
                    new_scope[tokens[i]] = helper(new_scope, tokens[i + 1])
                    i += 2
                return helper(new_scope, tokens[-1])

    return helper({}, expression)

