            current_segment[2] = current_segment[2].union(set([segments[i][2]]))
            current_segment[1] = max(current_segment[1], segments[i][1])
        else:
            painting.append([current_segment[0], current_segment[1], sum(current_segment[2])])
            current_segment = [segments[i][0], segments[i][1], set([segments[i][2]])]

    painting.append([current_segment[0], current_segment[1], sum(current_segment[2])])

    return painting

def licenseKeyFormatting(s, k):
    s = s.replace("-", "").upper()
    first_group_length = len(s) % k
    if first_group_length == 0:
        first_group_length = k
    result = [s[:first_group_length]]
    for i in range(first_group_length, len(s), k):
        result.append(s[i:i+k])
    return "-".join(result)

class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

def numComponents(head, nums):
    num_set = set(nums)
    current = head
    connected_components = 0
    connected = False

    while current:
        if current.val in num_set:
            connected = True
        else:
            if connected:
                connected_components += 1
            connected = False
        current = current.next

    if connected:
        connected_components += 1

    return connected_components

def tribonacci(n):
    if n == 0:
        return 0
    if n == 1 or n == 2:
        return 1

    a, b, c = 0, 1, 1
    for _ in range(n - 2):
        a, b, c = b, c, a + b + c

    return c

def maxNumberOfFamilies(n, reservedSeats):
        seats = {}
        for row, seat in reservedSeats:
            if row in seats:
                seats[row].add(seat)
            else:
                seats[row] = {seat}

        result = 2 * n
        for row in seats:
            cnt = 0
            if 2 not in seats[row] and 3 not in seats[row] and 4 not in seats[row] and 5 not in seats[row]:
                cnt += 1
            if 6 not in seats[row] and 7 not in seats[row] and 8 not in seats[row] and 9 not in seats[row]:
                cnt += 1
            if 4 not in seats[row] and 5 not in seats[row] and 6 not in seats[row] and 7 not in seats[row] and cnt == 0:
                cnt += 1
            result += cnt - 2

        return result

def findInMountainArray(target, mountain_arr):
    n = mountain_arr.length()
    l, r = 0, n - 1

    while l < r:
        mid = (l + r) // 2
        if mountain_arr.get(mid) < mountain_arr.get(mid + 1):
            l = mid + 1
        else:
            r = mid

    peak = l
    l, r = 0, peak

    while l <= r:
        mid = (l + r) // 2
        val = mountain_arr.get(mid)
        if val == target:
            return mid
        elif val < target:
            l = mid + 1
        else:
            r = mid - 1

    l, r = peak, n - 1

    while l <= r:
        mid = (l + r) // 2
        val = mountain_arr.get(mid)
        if val == target:
            return mid
        elif val > target:
            l = mid + 1
        else:
            r = mid - 1

    return -1

def maxSatisfied(customers, grumpy, minutes):
    n = len(customers)
    satisfied = 0
    max_satisfied = 0
    for i in range(n):
        if grumpy[i] == 0:
            satisfied += customers[i]
    for i in range(minutes):
        if grumpy[i] == 1:
            satisfied += customers[i]
    max_satisfied = satisfied
    for i in range(minutes, n):
        if grumpy[i] == 1:
            satisfied += customers[i]
        if grumpy[i - minutes] == 1:
            satisfied -= customers[i - minutes]
        max_satisfied = max(max_satisfied, satisfied)
    return max_satisfied

def reverse_segment(word, ch):
    if ch not in word:
        return word
    else:
        idx = word.index(ch)
        return word[:idx+1][::-1] + word[idx+1:]

def nextGreaterElement(nums1, nums2):
    stack, mapping = [], {}
    for num in nums2:
        while stack and stack[-1] < num:
            mapping[stack.pop()] = num
        stack.append(num)
    return [mapping.get(num, -1) for num in nums1]

def kthGrammar(n, k):
    if n == 1 and k == 1:
        return 0
    mid = 2 ** (n-1) // 2
    if k <= mid:
        return kthGrammar(n-1, k)
    else:
        return 1 - kthGrammar(n-1, k - mid)
